    answer_cols = ['number_project', 'average_monthly_hours', 'time_spend_company', 'Work_accident', 'promotion_last_5years', 'Department', 'salary', 'satisfaction_level', 'last_evaluation', 'left']


    class MergingTest(StageTest):

        def generate(self) -> List[TestCase]:
            return [TestCase(time_limit=15000)]

        def check(self, reply: str, attach):

            reply = reply.strip()

            if len(reply) == 0:
                return CheckResult.wrong("No output was printed")

            if reply.count('[') != 2 or reply.count(']') != 2:
                return CheckResult.wrong('Print all three answers as a list')

            num_of_lists = len(reply.split('\n'))
            if num_of_lists != 2:
                return CheckResult.wrong(f"Wrong number of answer lists. Expected 2, found {num_of_lists}.\n"
                                         f"Make sure that each list is printed on a separate line.")

            reply_index = reply.split('\n')[0]
            reply_cols = reply.split('\n')[1]

            index_reply_index_from = reply_index.find('[')
            index_reply_index_to = reply_index.find(']')
            list_str_reply_index = reply_index[index_reply_index_from: index_reply_index_to + 1]

            index_reply_cols_from = reply_cols.find('[')
            index_reply_cols_to = reply_cols.find(']')
            list_str_reply_cols = reply_cols[index_reply_cols_from: index_reply_cols_to + 1]

            try:
                list_str_reply_index = ast.literal_eval(list_str_reply_index)
                list_str_reply_cols = ast.literal_eval(list_str_reply_cols)
            except Exception:
                return CheckResult.wrong(f"Seems that output is in wrong format.\n"
                                         f"Make sure you use only the following Python structures in the output: string, int, float, list, dictionary")

            if not isinstance(list_str_reply_index, list):
                return CheckResult.wrong(f'Print 1st answer as a list')

            if not isinstance(list_str_reply_cols, list):
                return CheckResult.wrong(f'Print 2nd answer as a list')

            if len(list_str_reply_index) != len(answer_index):
                return CheckResult.wrong(f'List on the 1st line should contain {len(answer_index)} values, found {len(list_str_reply_index)}')

            if len(list_str_reply_cols) != len(answer_cols):
                return CheckResult.wrong(f'List in the 2nd line should contain {len(answer_cols)} values, found {len(list_str_reply_cols)}')

            for i in range(len(list_str_reply_index)):
                if answer_index[i] != list_str_reply_index[i]:
                    return CheckResult.wrong(f"Seems like your answer is not correct\n"
                                             f"Check element {i} of your 1st list")

            for i in range(len(list_str_reply_cols)):
                if answer_cols[i] != list_str_reply_cols[i]:
                    return CheckResult.wrong(f"Seems like your answer is not correct\n"
                                             f"Check element {i} of your 2nd list")

            return CheckResult.correct()


